import {useState} from 'react'

export default function MyBody(){
    const [name,setname]=useState('ידגחיגיגיגע')
    // בקומפוננטות מסוג פונקציה נגדיר רק פונקציה אנונימית
    c1=(event)=>{
        setname(event.target.value)
            }
    return <p>
        {name}
        שלום וברכה
        <input onChange={(x)=>this.c1(x)} placeholder="הכנס שם"></input>
        <Calc></Calc>

    </p>
}
 function Calc(){
    return <p>{3+8}</p>
}
